import React,{ Component } from 'react';
import { Link } from 'react-router-dom';
class Email extends Component {
    render() {
        return(
            <div className="wrap">
                <div className="container">
                    <div className="login">
                        <div className="title-bar">
                            <p>Login</p>
                        </div>
                        <div className="form-content">
                            <p className="text-right"><Link to="/login" className="" value="register">Login with Phone</Link></p>
                            <form className="form">
                                <input type="text" name="" placeholder="Email" required=""/>
                                <input type="password" name="" placeholder="Password" required=""/>
                                <button className="btn-com"><a href="register"
                                                               className="cl-white">Login</a></button>
                            </form>
                            <p className="text-right">
                                <Link to="/register" className="" value="register">New Account?REGISTER</Link>
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default Email;
